import React from 'react';
import ReactDOM from 'react-dom';
import { Grid, makeStyles,withStyles, Avatar } from "@material-ui/core";

const useStyles = makeStyles({
    appmain:{
        
        flexDirection: 'column',
        position: 'absolute',
        top : '75px',
        left : '235px',
        width : '82%',
        height : '100%',
        backgroundColor : '#fff'

    }
})

class Date1 extends React.Component {
    date = Date().split(' ');
    

    render () {
        console.log(this.date);
       return(
           <>
           <span style={{float:'Right', color:'grey', fontSize:'10px'}}>Last Updated:
           <font color='black'>
           {this.date[4]+', '+this.date[2]+' '+this.date[1]+' '+this.date[3]}
           </font>
           </span>
           
           </>
       )
    }
}





export default function AppMain() {
    const classes = useStyles()
    return (
        <div className={classes.appmain}>
            <br />
            <span style={{marginTop:'100px', paddingLeft:'25px', paddingTop:'100px', width:'200px'}}><b>Patient Information</b></span>
            <Date1 />
            <br />
            <br />
            <Grid container spacing={3}>
                <Grid item xs={1} style={{marginLeft:'30px'}}>
                <Avatar alt="Jim Halpert" src="/images/a1.jpg" style={{float:'left', height:'75px', width:'75px'}} />
                </Grid>
                <Grid item xs={1}>
                    LOL

                </Grid>

            </Grid>


        </div>
    )
}
